```java
package original;

import org.junit.Test;
import static org.junit.Assert.*;
import java.util.List;
import java.util.ArrayList;

public class FTest {

    @Test
    public void testSum() {
        assertEquals(0, F.f(0).get(0).intValue());
        assertEquals(1, F.f(1).get(0).intValue());
        assertEquals(3, F.f(2).get(0).intValue());
        assertEquals(6, F.f(3).get(0).intValue());
        assertEquals(15, F.f(5).get(4).intValue());
        assertEquals(28, F.f(7).get(6).intValue());
    }
